```javascript
function packEntities(entities) {
    let buffer = new ArrayBuffer(entities.length * 7 / 8);
    let view = new DataView(buffer);
    for (let i = 0; i < entities.length; i++) {
        let entity = entities[i];
        view.setUint8(i * 7 / 8, (entity.id << 3) | entity.size);
    }
    return buffer;
}

function unpackEntities(buffer) {
    let view = new DataView(buffer);
    let entities = [];
    for (let i = 0; i < buffer.byteLength; i += 7 / 8) {
        let entity = {};
        entity.id = view.getUint8(i) >> 3;
        entity.size = view.getUint8(i) & 7;
        entities.push(entity);
    }
    return entities;
}
```

The `packEntities` function creates an array buffer with enough space to hold all the entities. It then iterates over the entities, and for each one, it writes the id and size fields to the buffer using the `setUint8` method of the `DataView` object. The id is shifted 3 bits to the left to make room for the size field, and the size field is bitwise ORed with the id to combine them into a single 8-bit value.

The `unpackEntities` function creates a `DataView` object from the buffer, and then iterates over the buffer in 7/8-byte increments (since each entity is 7/8 bytes long). For each entity, it reads the id and size fields from the buffer using the `getUint8` method of the `DataView` object, and then extracts the id and size fields from the combined 8-bit value. The id is shifted 3 bits to the right to separate it from the size field. The resulting entities are stored in an array and returned.

